DROP TABLE IF EXISTS GENDERSPELLING;

GO

CREATE TABLE GENDERSPELLING (

INVALID_VALUE       VARCHAR(30),

NEW_VALUE           VARCHAR(1) CHECK(NEW_VALUE IN('F', 'M')),

PRIMARY KEY(INVALID_VALUE)

);





